sport:\r\n    type: TCP\r\n    server: NIO\r\n    heartbeat: true\r\n    enableTmClientBatchSendRequest: false\r\n    enableRmClientBatchSendRequest: true\r\n    enableTcServerBatchSendResponse: false\r\n    rpcRmRequestTimeout: 30000\r\n    rpcTmRequestTimeout: 30000\r\n    rpcTcRequestTimeout: 30000\r\n    threadFactory:\r\n        bossThreadPrefix: NettyBoss\r\n        workerThreadPrefix: NettyServerNIOWorker\r\n        serverExecutorThreadPrefix: NettyServerBizHandler\r\n        shareBossWorker: false\r\n        clientSelectorThreadPrefix: NettyClientSelector\r\n        clientSelectorThreadSize: 1\r\n        clientWorkerThreadPrefix: NettyClientWorkerThread\r\n        bossThreadSize: 1\r\n        workerThreadSize: default\r\n    shutdown:\r\n        wait: 3\r\n    serialization: seata\r\n    compressor: none','fd1434dc0501e7ae40a567db65a953ca','2022-09-01 14:12:33','2022-09-01 06:12:32','nacos','127.0.0.1','U','SEATA',''),(254,488,'seata-server.yml','SEATA_GROUP','','service:\n  # 事务群组 需要修改为自己的group，与客户端相对应\n  vgroupMapping:\n    starrism-mall-admin-group: default\n    starrism-mall-auth-group: default\n  default:\n    # 仅注册中心为file时使用\n    grouplist: 127.0.0.1:15000\n  enableDegrade: false\n  disableGlobalTransaction: false\n# 公共部分\ntransport:\n  # client和server通信编解码方式 seata(ByteBuf)、protobuf、kryo、hession、fst，默认seata\n  serialization: seata\n  # client和server通信数据压缩方式 none、gzip，默认none\n  compressor: none\n  # client和server通信心跳检测开关 默认true开启\n  heartbeat: true\nregistry:\n  # 注册中心类型 默认file，支持file 、nacos 、eureka、redis、zk、consul、etcd3、sofa、custom\n  type: nacos\nconfig:\n  # 配置中心类型 默认file，支持file、nacos 、apollo、zk、consul、etcd3、custom\n  type: nacos\n# server端\nserver:\n  undo:\n    # undo保留天数 默认7天,log_status=1（附录3）和未正常清理的undo\n    logSaveDays: 7\n    # undo清理线程间隔时间 默认86400000，单位毫秒\n    logDeletePeriod: 86400000\n  # 二阶段提交重试超时时长 单位ms,s,m,h,d,对应毫秒,秒,分,小时,天,默认毫秒。默认值-1表示无限重试。\n  # 公式: timeout>=now-globalTransactionBeginTime,true表示超时则不再重试\n  # (注: 达到超时时间后将不会做任何重试,有数据不一致风险,除非业务自行可校准数据,否者慎用)\n  maxCommitRetryTimeout:  -1\n  # 二阶段回滚重试超时时长 同maxCommitRetryTimeout\n  maxRollbackRetryTimeout: -1\n  recovery:\n    # 二阶段提交未完成状态全局事务重试提交线程间隔时间 默认1000，单位毫秒\n    committingRetryPeriod: 1000\n    # 二阶段异步提交状态重试提交线程间隔时间 默认1000，单位毫秒\n    asynCommittingRetryPeriod: 1000\n    # 二阶段回滚状态重试回滚线程间隔时间 默认1000，单位毫秒\n    rollbackingRetryPeriod: 1000\n    # 超时状态检测重试线程间隔时间 默认1000，单位毫秒，检测出超时将全局事务置入回滚会话管理器\n    timeoutRetryPeriod: 1000\nstore:\n  # 事务会话信息存储方式 file本地文件(不支持HA)，db数据库|redis(支持HA)\n  mode: db\n  db:\n    # db模式数据源类型 dbcp、druid、hikari；无默认值，store.mode=db时必须指定。\n    datasource: druid\n    # db模式数据库类型 mysql、oracle、db2、sqlserver、sybaee、h2、sqlite、access、postgresql、oceanbase；无默认值，store.mode=db时必须指定。\n    dbType: mysql\n    # db模式数据库驱动\n    driverClassName: com.mysql.jdbc.Driver\n    # db模式数据库url 在使用mysql作为数据源时，建议在连接参数中加上rewriteBatchedStatements=true\n    url: jdbc:mysql://1.15.57.220:9669/STARRISM_SEATA_DB?rewriteBatchedStatements=true&useUnicode=true&characterEncoding=UTF-8&useSSL=false&serverTimezone=GMT%2B8&allowMultiQueries=true&autoReconnect=true\n    # db模式数据库账户\n    user: root\n    # db模式数据库账户密码\n    password: 166Me2431...\n    # db模式数据库初始连接数 默认1\n    minConn: 5\n    # db模式数据库最大连接数 默认20\n    maxConn: 30\n    # db模式获取连接时最大等待时间 默认5000，单位毫秒\n    maxWait: 5000\n    # db模式全局事务表名 默认global_table\n    globalTable: global_table\n    # db模式分支事务表名 默认branch_table\n    branchTable: branch_table\n    # db模式全局锁表名 默认lock_table\n    lockTable: lock_table\n    # db模式查询全局事务一次的最大条数 默认100\n    queryLimit: 100\nmetrics:\n  # 是否启用Metrics 默认false关闭，在False状态下，所有与Metrics相关的组件将不会被初始化，使得性能损耗最低\n  enabled: false\n  # 指标注册器类型 Metrics使用的指标注册器类型，默认为内置的compact（简易）实现，这个实现中的Meter仅使用有限内存计数，性能高足够满足大多数场景；目前只能设置一个指标注册器实现\n  registryType: compact\n  # 指标结果Measurement数据输出器列表 默认prometheus，多个输出器使用英文逗号分割，例如\"prometheus,jmx\"，目前仅实现了对接prometheus的输出器\n  exporterList: prometheus\n  # prometheus输出器Client端口号 默认9898\n  exporterPrometheusPort: 9898\n# client端\nclient:\n  rm:\n    # 异步提交缓存队列长度 默认10000。 二阶段提交成功，RM异步清理undo队列\n    asyncCommitBufferLimit: 10000\n    lock:\n      # 校验或占用全局锁重试间隔 默认10，单位毫秒\n      retryInterval: 10\n      # 校验或占用全局锁重试次数 默认30\n      retryTimes: 30\n      # 分支事务与其它全局回滚事务冲突时锁策略 默认true，优先释放本地锁让回滚成功\n      retryPolicyBranchRollbackOnConflict: true\n    # 一阶段结果上报TC重试次数\n    reportRetryCount: 5\n    # 自动刷新缓存中的表结构\n    tableMetaCheckEnable: true\n    # sql解析类型 默认druid,可选antlr\n    sqlParserType: druid\n    # 是否上报一阶段成功\n    reportSuccessEnable: false\n  tm:\n    # 一阶段全局提交结果上报TC重试次数 默认1次，建议大于1\n    commitRetryCount: 5\n    # 一阶段全局回滚结果上报TC重试次数 默认1次，建议大于1\n    rollbackRetryCount: 5\n    # 降级开关 默认false。业务侧根据连续错误数自动降级不走seata事务(详细介绍请阅读附录6)\n    degradeCheck: false\n    # 升降级达标阈值 默认10\n    degradeCheckAllowTimes: 10\n    # 服务自检周期 默认2000,单位ms.每2秒进行一次服务自检\n    degradeCheckPeriod: 2000\n  undo:\n    # 二阶段回滚镜像校验\n    dataValidation: true\n    # undo序列化方式\n    logSerialization: jackson\n    # 只生成被更新列的镜像\n    onlyCareUpdateColumns: true\n    # 自定义undo表名\n    logTable: undo_log\n    compress:\n        enable: true\n        type: zip\n        threshold: 64k ','93df6df84daf3feaf484c0b40a9c87dc','2022-09-01 14:24:42','2022-09-01 06:24:42','nacos','127.0.0.1','U','SEATA','');

